  \"Physical data from CTD casts in the North Pacific Ocean from the THOMAS G. THOMPSON
  and the THOMAS WASHINGTON in support of the Marathon 2 Project from 05 May 1985
  to 07 September 1987 (NODC Accession 9400131)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:56.736183\",\n\t\"name\": \"physical-data-from-ctd-casts-in-the-north-pacific-ocean-from-the-thomas-g-thompson-and-the\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature and salinity profiles were
  collected from CTD casts in the North Pacific Ocean from the THOMAS G. THOMPSON
  and the THOMAS WASHINGTON. Data were collected by Scripps Institute of Oceanography
  (SIO) in support of the Marathon 2 Project from 05 May 1985 to 07 September 1987.
  Data were processed by NODC to the NODC standard F022 High-Resolution CTD/STD Output
  Format. Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f022.html.The
  F022 format contains high-resolution data collected using CTD (conductivity-temperature-depth)
  and STD (salinity-temperature-depth) instruments. As they are lowered and raised
  in the oceans, these electronic devices provide nearly continuous profiles of temperature,
  salinity, and other parameters. Data values may be subject to averaging or filtering
  or obtained by interpolation and may be reported at depth intervals as fine as 1m.
  Cruise and instrument information, position, date, time and sampling interval are
  reported for each station. Environmental data at the time of the cast (meteorological
  and sea surface conditions) may also be reported. The data record comprises values
  of temperature, salinity or conductivity, density (computed sigma-t), and possibly
  dissolved oxygen or transmissivity at specified depth or pressure levels. Data may
  be reported at either equally or unequally spaced depth or pressure intervals. A
  text record is available for comments.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
